            <h2>We specialize in Japanese Style Dog Grooming in West LA!</h2>
            <h3>Sub Sub title</h3>
        </MainStyled>
    );

}

export default Main;

const MainStyled = styled.main`
h1 {
    color: skyblue;
    background-color: white;
    font-size: 45px;
    padding: 100px;
}
h2 {
    padding: 10px;
}
